import logo from './logo.svg';
import './App.css';
import { useDispatch, useSelector } from 'react-redux';
import { getWeatherThunk } from './redux/reducer';
import { Header } from './Header';
import { SearchedList } from './SearchedCitiesList';

function App() {
  const data = useSelector((state) => state.reducer.currentWeather);

  const { description, temp } = data;
  return (
    <>
      <div className="App">Hello, {description}</div>
      <h2>{temp}</h2>
      <Header />
      <SearchedList />
    </>
  );
}

export default App;
